import useForm from 'hooks/useForm';
import React from 'react';
import * as Yup from 'yup';
const SignIn = () => {

    const initiateGdsForm = {
    username: '',
    password: '',
  };

  const validationSchema = Yup.object({
    username: Yup.string().required('Customer is required'),
    password: Yup.string().required('Country is required'),
  });

    const { values, errors, handleChange, handleAutocompleteChange, validate } = useForm({
    initialValues: initiateGdsForm,
    validationSchema,
  });
  return (
    <section className='w-full h-screen flex items-center justify-center'>
      <form className='w-9/12 h-[50%] flex flex-col gap-4'>
      <h1 className='font-bold text-xl' >Sign In</h1>
        <span>
          <label htmlFor='username'>Username</label>
          <input
            type='text'
            id='username'
            placeholder='Enter your username'
            className='border border-gray-300 rounded p-2 w-full'
          />
        </span>
        <span>
          <label htmlFor='password'>Password</label>
          <input
            type='password'
            id='password'
            placeholder='Enter your password'
            className='border border-gray-300 rounded p-2 w-full'
          />
        </span>
        <button type='submit' className='bg-blue-500 text-white rounded p-2'>
          Sign In
        </button>
      </form>
    </section>
  );
};

export default SignIn;
